import styled from 'styled-components'

const ContainerRoot = styled.div`
margin: 0;
padding: 0;
box-sizing: border-box;
`
const Container = styled.div`
 width: 100%;
 margin: 0 auto;
`
const ContainerLogin = styled.div`
 width: 50%;
 //min-height: 100vw;

 display: flex;
 flex-wrap: wrap;
 align-items: center;
 justify-content: center;
 padding: 15px;
 background: #111;
`
const WrapLogin = styled.div`
 width: 100%;
`
const LoginForm = styled.div`

`
const LoginFormTitle = styled.div`
display:block;
font-size: 40px;
color: azure;
line-height:1.2%;
text-align: center;
`

const LogoForm = styled.div`
 width: 5vw;
`

export {
  ContainerRoot,
  Container,
  ContainerLogin,
  WrapLogin,
  LoginForm,
  LoginFormTitle,
  LogoForm
}
